import React from 'react';
import '../App.css';

class Home extends React.Component {

  render() {
    return (
        <div className="App container" style={{height: '100vh', overflow: 'auto'}}>
          <img src="https://upload.wikimedia.org/wikipedia/commons/5/5a/Lake_Wakatipu-HD.jpg" style={{height: '100%', width: '100%'}}></img>
          <div className="centered">
          <h1 className="display-1" style={{fontSize: '10vh'}}>Welcome to Book Keeper</h1>
          <p><small>Your personal online bookshelf</small></p>

          </div>
          
        </div>
    );
  }
}
export default Home;
